import '../../css/filter/filter.css';
import District from "./District";
import Sex from "./Sex";
import Job from "./Job";
import Benefit from "./Benefit";
import {useEffect} from "react";
import axios from "axios";

function Filter() {

    useEffect(() => {
        axios.get()
    })

    return (
        <div className="filter">
            <District/>
            <Job/>
            <Benefit/>
            <Sex/>
        </div>
    )
}

export default Filter;
